import React from 'react'
import ShowDays from './ShowDays'
import Moment from 'moment'

const meet = Moment("02/06/2019","MM/DD/YYYY")
console.log(meet)
const time1 =  Moment();
console.log(time1)

console.log(time1.diff(meet,'days')+1)
console.log(time1.diff(meet,'years'))

class Love extends React.Component{
    constructor(props) {
    super(props);
    this.state = {
      time: new Date().toLocaleString(),
      total_days: 0,
      years: 0,
      months: 0,
      days:0,
      hours: 0,
      minutes: 0,
      second: 0,
    };
  }
  
  componentDidMount() {
    this.intervalID = setInterval(
      () => this.tick(),
      1000
    );
  }

  componentWillUnmount() {
    clearInterval(this.intervalID);
  }

  tick() {
    this.setState({
      time: new Date().toLocaleString()
    });
  }
    render(){
        return(
            <>
                <ShowDays></ShowDays>
            </>
        )
    }
}

export default Love;
